import React , {Component} from 'react';
import {ListGroup, ListGroupItem, ListGroupItemHeading, ListGroupItemText} from 'reactstrap'

class Chat extends Component {
  render(){

   
    return (
     
     
  <div className="chat-div">
   
  <div id="sidebar">
    <h4>Sunkychat</h4>
    <h6>Chat Room</h6>
   <ul>
     
     <li>Adewumi Sunkanmi</li>
     <li>DAre owonibi Samuel</li>
     <li>Awodele Timileyin</li>
     <li>Ogbere Ayomikun</li>
     <li>Olakunle job</li>
     <li>Bola Tolulope</li>
   </ul>
</div>
        
 </div>
     
      
    );
  }
 
}

export default Chat;
